import React, { Component } from "react";
import "./App.css";

const API_KEY = process.env.REACT_APP_API_KEY;

class App extends Component {
  state = {};

  componentDidMount = () => {
    fetch(
      `http://newsapi.org/v2/everything?q=bitcoin&from=2020-09-15&sortBy=publishedAt&apiKey=${API_KEY}`
    )
      .then((res) => res.json())
      .then((data) => console.log(data));
  };

  render() {
    return <div>hello</div>;
  }
}

export default App;
